import { Card, CardContent, Typography } from '@mui/material';
import React, { useState, useRef } from 'react';

function MusicasDiferentesOuvidasT({dados}) {
    const [currentIndex, setCurrentIndex] = useState(0);
    const [startX, setStartX] = useState(0);
    const [currentTranslate, setCurrentTranslate] = useState(0);
    const [isDragging, setIsDragging] = useState(false);
    const containerRef = useRef(null);
    const dragStartTime = useRef(null);
    
    const count = new Set(dados.map((e) => e.master_metadata_track_name));

    const slides = React.useMemo(() => {
        const count = new Set(dados.map((e) => e.master_metadata_track_name));
        const musicasUnicas = Array.from(count)
            .slice(0, 12)
            .map((nome, index) => {
                const artista = dados.find(d => d.master_metadata_track_name === nome)?.master_metadata_album_artist_name || '';
                const imagens = [
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,"
                ];

                return {
                    nome: nome,
                    artista: artista,
                    imagem: imagens[index % imagens.length]
                };
            });

        const slidesArray = [];
        for (let i = 0; i < 12; i += 3) {
            slidesArray.push(musicasUnicas.slice(i, i + 3));
        }
        return slidesArray;
    }, [dados]);

    const handleDragStart = (e) => {
        e.preventDefault();
        setIsDragging(true);
        setStartX(e.type === 'mousedown' ? e.pageX : e.touches[0].clientX);
        dragStartTime.current = Date.now();
        setCurrentTranslate(0);
        
        if (containerRef.current) {
            containerRef.current.style.cursor = 'grabbing';
            containerRef.current.style.transition = 'none';
        }
    };

    const handleDragMove = (e) => {
        if (!isDragging) return;
        e.preventDefault();
        
        const x = e.type === 'mousemove' ? e.pageX : e.touches[0].clientX;
        const walk = x - startX;
        
        setCurrentTranslate(walk);
        
        if (containerRef.current) {
            containerRef.current.style.transform = `translateX(${walk}px)`;
        }
    };

    const handleDragEnd = (e) => {
        e.preventDefault();
        if (!isDragging) return;
        
        setIsDragging(false);
        const moveTime = Date.now() - dragStartTime.current;
        const threshold = 100;

        if (Math.abs(currentTranslate) > threshold || (Math.abs(currentTranslate) > 50 && moveTime < 200)) {
            if (currentTranslate > 0) {
                setCurrentIndex(current => current === 0 ? slides.length - 1 : current - 1);
            } else {
                setCurrentIndex(current => current === slides.length - 1 ? 0 : current + 1);
            }
        }

        if (containerRef.current) {
            containerRef.current.style.cursor = 'grab';
            containerRef.current.style.transition = 'transform 0.3s ease-out';
            containerRef.current.style.transform = 'translateX(0)';
        }
        
        setCurrentTranslate(0);
    };

    const nextSlide = () => {
        setCurrentIndex(current => current === slides.length - 1 ? 0 : current + 1);
    };

    const prevSlide = () => {
        setCurrentIndex(current => current === 0 ? slides.length - 1 : current - 1);
    };

    React.useEffect(() => {
        const timer = setInterval(() => {
            if (!isDragging) {
                setCurrentIndex(current => current === slides.length - 1 ? 0 : current + 1);
            }
        }, 5000);
        return () => clearInterval(timer);
    }, [isDragging, slides.length]);

    return (
        <Card sx={{
            bgcolor: '#666666',
            border: '2px solid #808080',
            borderRadius: '15px',
            color: 'white',
            margin: '20px',
            height: '280px'
        }}>
            <CardContent>
                <Typography variant="h6" align="center" gutterBottom>
                    Msicas Diferentes Ouvidas
                </Typography>
                <Typography variant="h5" align="center" gutterBottom>
                    Plays: {count.size}
                </Typography>

                <div style={{
                    position: 'relative',
                    height: '160px',
                    marginTop: '10px',
                    overflow: 'hidden'
                }}>
                    <button
                        onClick={prevSlide}
                        style={{
                            position: 'absolute',
                            left: '5px',
                            top: '50%',
                            transform: 'translateY(-50%)',
                            backgroundColor: '#5B21B6',
                            border: 'none',
                            borderRadius: '50%',
                            padding: '8px',
                            cursor: 'pointer',
                            color: 'white',
                            fontSize: '24px',
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'center',
                            width: '36px',
                            height: '36px',
                            zIndex: 10
                        }}
                    >
                        {'<'}
                    </button>
                    <button
                        onClick={nextSlide}
                        style={{
                            position: 'absolute',
                            right: '5px',
                            top: '50%',
                            transform: 'translateY(-50%)',
                            backgroundColor: '#5B21B6',
                            border: 'none',
                            borderRadius: '50%',
                            padding: '8px',
                            cursor: 'pointer',
                            color: 'white',
                            fontSize: '24px',
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'center',
                            width: '36px',
                            height: '36px',
                            zIndex: 10
                        }}
                    >
                        {'>'}
                    </button>
                    <div 
                        ref={containerRef}
                        style={{
                            display: 'flex',
                            justifyContent: 'space-between',
                            padding: '0 70px',
                            cursor: isDragging ? 'grabbing' : 'grab',
                            transform: `translateX(${currentTranslate}px)`,
                            transition: isDragging ? 'none' : 'transform 0.3s ease-out',
                            userSelect: 'none'
                        }}
                        onMouseDown={handleDragStart}
                        onMouseMove={handleDragMove}
                        onMouseUp={handleDragEnd}
                        onMouseLeave={handleDragEnd}
                        onTouchStart={handleDragStart}
                        onTouchMove={handleDragMove}
                        onTouchEnd={handleDragEnd}
                    >
                        {slides[currentIndex].map((musica, index) => (
                            <div key={index} style={{
                                width: '30%',
                                backgroundColor: '#444444',
                                borderRadius: '8px',
                                padding: '8px',
                                textAlign: 'center',
                                transition: isDragging ? 'none' : 'transform 0.3s ease'
                            }}>
                                <p style={{
                                    margin: '0 0 4px 0',
                                    fontSize: '14px',
                                    fontWeight: 'bold'
                                }}>
                                    {musica.nome}
                                </p>
                                <h3 style={{
                                    margin: '0 0 8px 0',
                                    fontSize: '12px',
                                    whiteSpace: 'nowrap',
                                    overflow: 'hidden',
                                    textOverflow: 'ellipsis'
                                }}>
                                    {musica.artista}
                                </h3>
                                <img
                                    src={musica.imagem}
                                    alt={musica.nome}
                                    style={{
                                        width: '100%',
                                        height: '100px',
                                        objectFit: 'cover',
                                        borderRadius: '4px'
                                    }}
                                    draggable={false}
                                />
                            </div>
                        ))}
                    </div>
                </div>

                <div style={{
                    display: 'flex',
                    justifyContent: 'center',
                    gap: '8px',
                    marginTop: '8px'
                }}>
                    {[0, 1, 2, 3].map((index) => (
                        <button
                            key={index}
                            onClick={() => setCurrentIndex(index)}
                            style={{
                                width: '8px',
                                height: '8px',
                                borderRadius: '50%',
                                backgroundColor: index === currentIndex ? 'white' : 'rgba(255,255,255,0.5)',
                                border: 'none',
                                padding: 0,
                                cursor: 'pointer'
                            }}
                        />
                    ))}
                </div>
            </CardContent>
        </Card>
    );
}

export default MusicasDiferentesOuvidasT;